    render(){
        return(
            <div>
                <Header />

                <div class = "establish">
                    <div class = "establish_header">
                        Establish
                    </div>
                </div>

                <div class = "service">
                    <div class="service"> 
                        Service: 
                    </div>
                    <img src = {AAService} alt = "ava's angel service"/>
                </div>

                <div class="activity"> Activity: </div>

                <Footer />
            </div>
            )
        }
    }

export default About;
